webpackJsonp([4959851461435],{997:function(e,t){e.exports={data:{allPostTitles:{edges:[{node:{frontmatter:{title:"Contributing",group:"Internals",type:"doc"},fields:{slug:"/contributing"}}},{node:{frontmatter:{title:"Cost Estimate",group:"Internals",type:"doc"},fields:{slug:"/cost-estimate"}}},{node:{frontmatter:{title:"Create a New Admin User",group:"Advanced Usage",type:"doc"},fields:{slug:"/create-a-new-admin-user"}}},{node:{frontmatter:{title:"Integrate with Other Monitoring Systems",group:"Advanced Usage",type:"doc"},fields:{slug:"/integrate-with-other-monitoring-systems"}}},{node:{frontmatter:{title:"Supported AWS Regions",group:"Basic Usage",type:"doc"},fields:{slug:"/supported-aws-regions"}}},{node:{frontmatter:{title:"Set up Custom Domain",group:"Advanced Usage",type:"doc"},fields:{slug:"/set-up-custom-domain"}}},{node:{frontmatter:{title:"Get Started",group:"Basic Usage",type:"doc"},fields:{slug:"/get-started"}}},{node:{frontmatter:{title:"Upgrading LambStatus",group:"Basic Usage",type:"doc"},fields:{slug:"/upgrading-lamb-status"}}},{node:{frontmatter:{title:"Set up the development environment",group:"Internals",type:"doc"},fields:{slug:"/set-up-the-development-environment"}}}]},postBySlug:{html:'<p>LambStatus has the APIs to integrate with other systems. The APIs enable you to change the component\'s status, create a new incident and so on.</p>\n<p>This page introduces the <strong>Metrics API</strong>. With this, you can submit the metrics data your monitoring systems collect and show the data in the status page. Read <a href="https://lambstatus.github.io/apidocs/">the API docs</a> for other APIs.</p>\n<h3 id="set-up"><a href="#set-up" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Set up</h3>\n<p>At first, you need to create a metric to submit your data points.</p>\n<ol>\n<li>Visit the \'Metrics\' tab of the admin page and click the \'+ Metric\' button.</li>\n</ol>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 42.8007889546351%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="SelfTypeMetrics3"\n        title=""\n        src="/static/SelfTypeMetrics3-862cf3cf5653df1ab6bbff24369dacc1-ffc88.png"\n        srcset="/static/SelfTypeMetrics3-862cf3cf5653df1ab6bbff24369dacc1-d16f8.png 198w,\n/static/SelfTypeMetrics3-862cf3cf5653df1ab6bbff24369dacc1-f21b1.png 395w,\n/static/SelfTypeMetrics3-862cf3cf5653df1ab6bbff24369dacc1-ffc88.png 790w,\n/static/SelfTypeMetrics3-862cf3cf5653df1ab6bbff24369dacc1-81e7e.png 1185w,\n/static/SelfTypeMetrics3-862cf3cf5653df1ab6bbff24369dacc1-7cfeb.png 1580w,\n/static/SelfTypeMetrics3-862cf3cf5653df1ab6bbff24369dacc1-6cdb6.png 2028w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n<ol start="2">\n<li>Choose the \'Self\' option. The metric must be the \'Self\' type to submit the data points via API.</li>\n</ol>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 87.19723183391004%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="SelfTypeMetrics4"\n        title=""\n        src="/static/SelfTypeMetrics4-d9139e679660c1a1b7ff7e40245efcfe-ffc88.png"\n        srcset="/static/SelfTypeMetrics4-d9139e679660c1a1b7ff7e40245efcfe-d16f8.png 198w,\n/static/SelfTypeMetrics4-d9139e679660c1a1b7ff7e40245efcfe-f21b1.png 395w,\n/static/SelfTypeMetrics4-d9139e679660c1a1b7ff7e40245efcfe-ffc88.png 790w,\n/static/SelfTypeMetrics4-d9139e679660c1a1b7ff7e40245efcfe-81e7e.png 1185w,\n/static/SelfTypeMetrics4-d9139e679660c1a1b7ff7e40245efcfe-7cfeb.png 1580w,\n/static/SelfTypeMetrics4-d9139e679660c1a1b7ff7e40245efcfe-d9cd7.png 1734w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n<ol start="3">\n<li>Enter other parameters as you want and click the "ADD" button.</li>\n</ol>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 71.07061503416855%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="SelfTypeMetrics5"\n        title=""\n        src="/static/SelfTypeMetrics5-389df4cffd908ea4803f8f351d5523e5-ffc88.png"\n        srcset="/static/SelfTypeMetrics5-389df4cffd908ea4803f8f351d5523e5-d16f8.png 198w,\n/static/SelfTypeMetrics5-389df4cffd908ea4803f8f351d5523e5-f21b1.png 395w,\n/static/SelfTypeMetrics5-389df4cffd908ea4803f8f351d5523e5-ffc88.png 790w,\n/static/SelfTypeMetrics5-389df4cffd908ea4803f8f351d5523e5-81e7e.png 1185w,\n/static/SelfTypeMetrics5-389df4cffd908ea4803f8f351d5523e5-7cfeb.png 1580w,\n/static/SelfTypeMetrics5-389df4cffd908ea4803f8f351d5523e5-9c196.png 1756w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n<h3 id="submit-the-data-points"><a href="#submit-the-data-points" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Submit the data points</h3>\n<p>Now you can submit the data points using the API. The steps below use the python script prepared for this, but you may write your own script seeing <a href="https://lambstatus.github.io/apidocs/#submit-data-points">the API docs</a>.</p>\n<ol>\n<li>Click the \'Preview\' button of the metric you\'ve just created.</li>\n</ol>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 44.2495126705653%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="SelfTypeMetrics7"\n        title=""\n        src="/static/SelfTypeMetrics7-c21c499b90e0e5fca0bfc4dd93a82bfe-ffc88.png"\n        srcset="/static/SelfTypeMetrics7-c21c499b90e0e5fca0bfc4dd93a82bfe-d16f8.png 198w,\n/static/SelfTypeMetrics7-c21c499b90e0e5fca0bfc4dd93a82bfe-f21b1.png 395w,\n/static/SelfTypeMetrics7-c21c499b90e0e5fca0bfc4dd93a82bfe-ffc88.png 790w,\n/static/SelfTypeMetrics7-c21c499b90e0e5fca0bfc4dd93a82bfe-81e7e.png 1185w,\n/static/SelfTypeMetrics7-c21c499b90e0e5fca0bfc4dd93a82bfe-7cfeb.png 1580w,\n/static/SelfTypeMetrics7-c21c499b90e0e5fca0bfc4dd93a82bfe-b8eaf.png 2052w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n<ol start="2">\n<li>Click the link to the script in the dialog.</li>\n</ol>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 54.88917861799217%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="SelfTypeMetrics8"\n        title=""\n        src="/static/SelfTypeMetrics8-b5ebca97a863f64dc9f5cb3c9bd1e257-ffc88.png"\n        srcset="/static/SelfTypeMetrics8-b5ebca97a863f64dc9f5cb3c9bd1e257-d16f8.png 198w,\n/static/SelfTypeMetrics8-b5ebca97a863f64dc9f5cb3c9bd1e257-f21b1.png 395w,\n/static/SelfTypeMetrics8-b5ebca97a863f64dc9f5cb3c9bd1e257-ffc88.png 790w,\n/static/SelfTypeMetrics8-b5ebca97a863f64dc9f5cb3c9bd1e257-81e7e.png 1185w,\n/static/SelfTypeMetrics8-b5ebca97a863f64dc9f5cb3c9bd1e257-75042.png 1534w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n<ol start="3">\n<li>Copy and paste the script and run it on your local machine. The script randomly generates the data points for the past 24 hours and submits them.</li>\n</ol>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 83.41404358353512%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="SelfTypeMetrics9"\n        title=""\n        src="/static/SelfTypeMetrics9-bd2bd22df953472df7d35f3994a0edcd-ffc88.png"\n        srcset="/static/SelfTypeMetrics9-bd2bd22df953472df7d35f3994a0edcd-d16f8.png 198w,\n/static/SelfTypeMetrics9-bd2bd22df953472df7d35f3994a0edcd-f21b1.png 395w,\n/static/SelfTypeMetrics9-bd2bd22df953472df7d35f3994a0edcd-ffc88.png 790w,\n/static/SelfTypeMetrics9-bd2bd22df953472df7d35f3994a0edcd-81e7e.png 1185w,\n/static/SelfTypeMetrics9-bd2bd22df953472df7d35f3994a0edcd-7cfeb.png 1580w,\n/static/SelfTypeMetrics9-bd2bd22df953472df7d35f3994a0edcd-633fd.png 1652w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>\n<ol start="4">\n<li>Reopen the \'Preview\' dialog. The data points you\'ve just sent must be shown!</li>\n</ol>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 790px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 67.06827309236947%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="SelfTypeMetrics10"\n        title=""\n        src="/static/SelfTypeMetrics10-ea10c350f795b18e76e4bdc1eef2bd46-ffc88.png"\n        srcset="/static/SelfTypeMetrics10-ea10c350f795b18e76e4bdc1eef2bd46-d16f8.png 198w,\n/static/SelfTypeMetrics10-ea10c350f795b18e76e4bdc1eef2bd46-f21b1.png 395w,\n/static/SelfTypeMetrics10-ea10c350f795b18e76e4bdc1eef2bd46-ffc88.png 790w,\n/static/SelfTypeMetrics10-ea10c350f795b18e76e4bdc1eef2bd46-81e7e.png 1185w,\n/static/SelfTypeMetrics10-ea10c350f795b18e76e4bdc1eef2bd46-b1ed0.png 1494w"\n        sizes="(max-width: 790px) 100vw, 790px"\n      />\n    </span>\n  </span>\n  </p>',timeToRead:1,excerpt:"LambStatus has the APIs to integrate with other systems. The APIs enable you to change the component's status, create a new incident and so…",frontmatter:{title:"Integrate with Other Monitoring Systems"},fields:{slug:"/integrate-with-other-monitoring-systems"}}},pathContext:{slug:"/integrate-with-other-monitoring-systems"}}}});
